import { EnchereItem } from "../components/EnchereItem";
import { NavBar } from "../components/NavBar";
import { RechargeItem } from "../components/RechargeItem";

export default function Acceuil(){
    const encheres = [
        {details:"Vente collier en or"},
        {details:"Vente collier en argent"},
        {details:"Vente collier en bronze"}
    ];

    const demandeRechargement = [
        {
            client:"Idealy",
            compte:100
        },
        {
            client:"Aina",
            compte:500
        }
    ];
    return(
        <div>
            <NavBar/>
            <div class="container">
                <h1>List des encheres en attente de validation</h1>
                <hr />
                {encheres.map((value)=><EnchereItem encheres={value}/>)}
                <hr />
                <h1>List des recharges en attente de validation</h1>
                <hr />
                {demandeRechargement.map((value)=><RechargeItem valeur={value}/>)}
            </div>
        </div>
    );
}
